mapper.select:
select 

from public.w_user_system_sub
where user_id = #{userId,jdbcType=VARCHAR}
  and upload_user_id = #{uploadUserId,jdbcType=VARCHAR}
  and upload_user_ts = #{uploadUserTs,jdbcType=TIMESTAMP}
  and upload_session = #{uploadSession,jdbcType=VARCHAR}

mapper.delete:
delete from public.w_user_system_sub
where user_id = #{userId,jdbcType=VARCHAR}
  and upload_user_id = #{uploadUserId,jdbcType=VARCHAR}
  and upload_user_ts = #{uploadUserTs,jdbcType=TIMESTAMP}
  and upload_session = #{uploadSession,jdbcType=VARCHAR}
